import React from 'react'

export default function Square_rounded_corner_btn(props) {
  return (
    <div>
      <span className=' bg-gradient-to-tr from-[#FF451D] to-[#FE7804] rounded-lg text-white font-semibold py-2 px-8'>{props.value}</span>
    </div>
  )
}
